import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function SelectLabels() {
  const [age, setAge] = React.useState('');

  const handleChange = (event) => {
    setAge(event.target.value);
  };

  return (
    <div>
      <FormControl sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-helper-label">Age</InputLabel>
        <Select
          labelId="demo-simple-select-helper-label"
          id="demo-simple-select-helper"
          value={pmExpertise}
          label="PM expertise"
          onChange={handleChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Basic</MenuItem>
          <MenuItem value={20}>Average</MenuItem>
          <MenuItem value={30}>Good</MenuItem>
          <MenuItem value={40}>Advanced</MenuItem>
        </Select>
        <FormHelperText>Select PM expertise</FormHelperText>
      </FormControl>
      <FormControl sx={{ m: 1, minWidth: 120 }}>
        <Select
          labelId="demo-simple-select-helper-label"
          id="demo-simple-select-helper"
          value={analysisExpertise}
          label="Analysis expertise"
          onChange={handleChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={10}>Basic</MenuItem>
          <MenuItem value={20}>Average</MenuItem>
          <MenuItem value={30}>Good</MenuItem>
          <MenuItem value={40}>Advanced</MenuItem>
        </Select>
        <FormHelperText>Select analysis expertise</FormHelperText>
      </FormControl>
    </div>
  );
}
